def merge_the_tools(string, k):
    n = len(string)//k
    #print(len(string))
    for i in range(n):
        ti = ''
        for ch in string[i*k:i*k+k]:
            if ch not in ti:
                ti += ch
        print(ti)

#string, k = '', 3452
string, k = '01223456780112345678', 10
merge_the_tools(string, k)